import { Text, View } from 'react-native'
import React from 'react'
import tw from 'tailwind-react-native-classnames'

const Schedule = () => {
  return (
    <View style={tw`w-11/12 h-40 bg-red-700 bottom-10 rounded-lg`}>
      <Text>Schedule</Text>
    </View>
  )
}

export default Schedule
